import React, { useEffect,useState } from 'react';
import '../assets/css/style.css';
import Footer from '../components/Footer';
import Button from '../components/Button';
// import HeaderProfil from '../components/HeaderProfil';
import Header from '../components/Header';
import '../assets/fontawesome-5/css/all.css';
import WelcomeContainer from '../components/WelcomeContainer';
import SideCardContainer from '../components/SideCardContainer';
import Card from '../components/Card';
import CardDetails from '../components/CardDetails';

const Accueil = () => {
    useEffect(() => {
        document.title = 'Accueil';
    }, []);


    return (
        <div className='page'>
            {/* <HeaderProfil link='/' logo = "/assets/img/PNG/Logo.png" description = "Logo" icon = 'fas fa-user-circle' pseudo = 'Profil' lien1 = '/ficheProfil' text1 = 'Voir ma fiche' text2 = 'Se déconnecter'/> */}
            <Header logo = "/assets/img/PNG/Logo.png" lien = '/connexion' text2 = 'Se connecter'/>
            <main className='Landing'>
                <section className='MidLeft'>
                    <WelcomeContainer text = 'Bienvenue sur Farm Game'>
                        <p>Vous êtes actuellement sur le site de Farm Game.<br/>Ici vous pouvez voir toutes les cultures, terrains et propriétaires du jeu.<br/>Dans ce menu, vous pouvez accéder à l'historique des simulations, initier des discussions et faire des simulations de cultures.</p>
                        <section>
                            <Button link='#' text ='Voir liste des cultures'/>
                            <Button link='#' text ='Valider un terrain'/>
                            <Button link='#' text ='Voir les statistiques'/>
                        </section>
                    </WelcomeContainer>

                </section>
                <section className='MidRight'>

                </section>
            </main>
            <Footer copyright = "© Tous droits réservés. Farm Game 2024"></Footer>
        </div>
    );
};

export default Accueil;
